import { color } from 'echarts';
import { getOpacityColor } from './utils';
import colors from './ectThemeFgwColors';

function getBarLinearColor(color: any, index: number) {
    const i = index % colors.length;
    return {
        type: 'linear',
        x: 0,
        y: 0,
        x2: 0,
        y2: 1,
        colorStops: [
            {
                offset: 0,
                color: colors[i][0],
            },
            {
                offset: 1,
                color: colors[i][1],
            },
            {
                offset: 1,
                color: getOpacityColor(color, '0.15'),
            },
        ],
        global: false,
    };
}
function getPieColor(color: any, index: number) {
    const i = index % colors.length;
    return {
        type: 'linear',
        x: 1,
        y: 0,
        x2: 0,
        y2: 0,
        colorStops: [
            {
                offset: 0,
                color: colors[i][0],
            },
            {
                offset: 1,
                color: colors[i][0],
            }
        ],
        global: false,
    };
}

